import React from 'react';
import img1 from '../assets/image-al1.jpg';
import img2 from '../assets/image-al2.jpg';
import img3 from '../assets/images-al3.jpg';

const CyberAlumni = () => {
  return (
    <div className="p-8 bg-gray-50 min-h-screen">
      <h1 className="text-4xl font-bold text-center mb-6">Cybersecurity Alumni</h1>
      <p className="text-center text-gray-600 mb-10 max-w-3xl mx-auto">
        Discover the cybersecurity alumni protecting systems and infrastructure across the globe, from national security agencies to tech giants.
      </p>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {/* Alumni 1 */}
        <div className="bg-white shadow-lg rounded-2xl p-6 hover:shadow-xl transition">
          <img src={img1} alt="Vikram Singh" className="w-full h-32 object-cover rounded-xl mb-4" />
          <h2 className="text-xl font-semibold">Vikram Singh</h2>
          <p className="text-sm text-gray-500">Cybersecurity Lead, Cisco</p>
          <p className="text-sm mt-2">Class of 2012</p>
        </div>

        {/* Alumni 2 */}
        <div className="bg-white shadow-lg rounded-2xl p-6 hover:shadow-xl transition">
          <img src={img2} alt="Megha Jain" className="w-full h-32 object-cover rounded-xl mb-4" />
          <h2 className="text-xl font-semibold">Megha Jain</h2>
          <p className="text-sm text-gray-500">Security Analyst, Deloitte</p>
          <p className="text-sm mt-2">Class of 2015</p>
        </div>

        {/* Alumni 3 */}
        <div className="bg-white shadow-lg rounded-2xl p-6 hover:shadow-xl transition">
          <img src={img3} alt="Ankit Sharma" className="w-full h-32 object-cover rounded-xl mb-4" />
          <h2 className="text-xl font-semibold">Ankit Sharma</h2>
          <p className="text-sm text-gray-500">Ethical Hacker, HackerOne</p>
          <p className="text-sm mt-2">Class of 2017</p>
        </div>
      </div>
    </div>
  );
};

export default CyberAlumni;
